Special Forces : Sri Lanka LRP (Documentary)
Original air date - September 22, 2013
Source - mvgroup (Thanks)
Subtitle - N/A


Sri Lanka went through a two-decade long civil war that saw 

the country plunged into chaos. In 1996, a new Special Forces 

unit was formed to try and bring the conflict to an end. This 

top-secret group went on to play a huge role, operating deep 

behind enemy lines, gathering intelligence and eliminating 

key targets. Until now, no one has ever filmed this elite 

unit, and until the end of the war, the government kept their 

very existence under wraps. History Channel gets exclusive 

access behind the scenes and uncovers the training of Sri 

Lanka's Long Range Patrol unit of the Special Forces Brigade. 

Selected from the very elite of the Special Forces unit, they 

embark on a grueling 6-month training program. It all starts 

with three weeks of relentless physical and psychological 

torture that will push them to their absolute limits and 

break all but the best. 

